import data_info
import helpers

from deepblue_client import DeepBlueClient

class TestPattern(helpers.TestCase):

  def test_pattern_chromosome(self):
    epidb = DeepBlueClient(address="localhost", port=31415)
    self.init_base(epidb)

    genome_info = "chr19 59128983"
    res = epidb.add_genome("hg19_only_chr19", "hg19 with only the chr19", genome_info, self.admin_key)
    self.assertSuccess(res)

    sequence = open("data/genomes/chromosomes/hg19.chr19").read().replace("\n", "")
    res = epidb.upload_chromosome("hg19_only_chr19", "chr19", sequence, self.admin_key)
    self.assertSuccess(res)

    status, q_id = epidb.find_motif("CG", "hg19_only_chr19", "chr19", None, None, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 1057376)

    status, q_id = epidb.find_motif("CACTAATTTCATC", "hg19_only_chr19", "chr19", None, None, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 3)

    status, q_id = epidb.find_motif("CACTAATTTCATC", "hg19_only_chr19", "chr19", 1500, 10000000, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 1)

    status, q_id = epidb.find_motif("TATA", "hg19_only_chr19", None, None, None, True, self.admin_key)
    self.assertSuccess(status, q_id)
    status, q_id2 = epidb.find_motif("TATA", "hg19_only_chr19", None, None, None, True, self.admin_key)
    self.assertSuccess(status, q_id2)

    self.assertEquals(q_id, q_id2)
    status, info = epidb.info(q_id, self.admin_key)
    status, info2 = epidb.info(q_id2, self.admin_key)

    self.assertEquals(info, info2)
    self.assertSuccess(status, info)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 185269)

    status, q_id = epidb.find_motif("TATA", "hg19_only_chr19", None, None, None, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 159464)

    status, q_id = epidb.find_motif("TATA", "hg19_only_chr19", "chr19", 15000, 100000, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 149)

    status, q_id = epidb.find_motif("TATA", "hg19_only_chr19", "chr19", -3313, 1000000000, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 159464)

    status, q_id = epidb.find_motif("TATA", "hg19_only_chr19", "chr19", None, None, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 159464)

    status, q_id = epidb.find_motif("TATA+", "hg19_only_chr19", None, None, None, True, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 185269)

    status, q_id = epidb.find_motif("TATA+", "hg19_only_chr19", None, None, None, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 159464)

    status, q_id = epidb.find_motif("TATA*", "hg19_only_chr19", None, None, None, True, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 698653)

    status, q_id = epidb.find_motif("TATA*", "hg19_only_chr19", None, None, None, False, self.admin_key)
    self.assertSuccess(status, q_id)
    status, req = epidb.count_regions(q_id, self.admin_key)
    self.assertSuccess(status, req)
    c = self.count_request(req)
    self.assertEquals(c, 638969)

